import React from "react";
import { render } from "react-dom";
import Carousel from "../components/Carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";

const About = () => (
  <div className="container">
    <h3>Materialize Carousel</h3>
    <Carousel>
      <div class="carousel" id="demo-carousel">
        <a class="carousel-item" href="https://cdn.vox-cdn.com/thumbor/1lkbiwsmSbovu-HAyjWeZTcGQo8=/0x0:1920x1280/1200x800/filters:focal(807x487:1113x793)/cdn.vox-cdn.com/uploads/chorus_image/image/57340051/apples_2811968_1920.0.jpg"></a>
        <a class="carousel-item" href="https://cdn1.sph.harvard.edu/wp-content/uploads/sites/30/2018/08/bananas-1354785_1920-1200x800.jpg"></a>
        <a class="carousel-item" href="https://i0.wp.com/post.healthline.com/wp-content/uploads/2020/01/mango-bowl-fruit-1296x728-header-1296x728.jpg?w=1155&h=1528"></a>
        <a class="carousel-item" href="https://www.eatright.org/-/media/eatrightrecipeimages/strawberry-chocolate-ladybugs-881906660.jpg"></a>
        <a class="carousel-item" href="https://image.shutterstock.com/image-photo/blueberry-fresh-raw-berries-leaves-260nw-593906903.jpg"></a>
      </div>
    </Carousel>
  </div>
);

render(<About />, document.getElementById("root"));


export default About;
